<div class="entities" style="line-height: 2.5; direction: ltr">AM2389 , a high-affinity , in vivo potent 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554

</mark>
 - receptor-selective cannabinergic ligand as evidenced by drug discrimination in rats and hypothermia testing in mice . RATIONALE : The endocannabinoid signaling system ( ECS ) has been targeted for developing novel therapeutics since ECS dysfunction has been implicated in various pathologies . Current focus is on chemical modifications of the hexahydrocannabinol ( HHC ) nabilone ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00486
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MENMAX</span>
</mark>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00486
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 (  ) ) . OBJECTIVE : To characterize the novel , high-affinity cannabinoid receptor 1 ( CB ( 1 ) R ) HHC-ligand AM2389 [ 9 - hydroxy - 3 - ( 1 - hexyl-cyclobut - 1 - yl ) - hexahydrocannabinol in two rodent pre-clinical assays . MATERIALS AND METHODS : CB ( 1 ) R mediation of AM2389 - induced hypothermia in mice was evaluated with AM251 , a CB ( 1 ) R-selective antagonist / inverse agonist . Additionally , two groups of rats discriminated the full cannabinergic aminoalkylindole AM5983 ( 0.18 and 0.56 mg / kg ) from vehicle 20 min post-injection in a two-choice operant conditioning task motivated by 0.1 % saccharin / water . Generalization / substitution tests were conducted with AM2389 , AM5983 , and  ( 9 ) - tetrahydrocannabinol (  ( 9 ) - THC ) . RESULTS :  ( 9 ) - THC ( 30 mg / kg ) - induced hypothermia exhibited a faster onset and shorter duration of action compared with AM2389 ( 0.1 and 0.3 mg / kg ) . AM251 ( 3 and 10 mg / kg ) attenuated / blocked hypothermia induced by 0.3 mg / kg AM2389 . In drug discrimination , the order of potency was AM2389 &gt; AM5983 &gt;  ( 9 ) - THC with ED ( 50 ) values of 0.0025 , 0.0571 , and 0.2635 mg / kg , respectively , in the low-dose condition . The corresponding ED ( 50 ) values in the high-dose condition were 0.0069 , 0.1246 , and 0.8438 mg / kg , respectively . Onset of the effects of AM2389 was slow with a protracted time-course ; the functional , perceptual in vivo half-life was approximately 17 h . CONCLUSIONS : This potent cannabinergic HHC exhibited a slow onset of action with a protracted time-course . The AM2389 chemotype appears well suited for further drug development , and AM2389 currently is used to probe behavioral consequences of sustained ECS activation .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Possible role of cholecystokinin-A receptors in regulation of thyrotropin ( DB00024 ) secretion in male rats . We studied the importance of cholecystokinin ( CCK ) system in the regulation of thyrotropin ( DB00024 ) and prolactin ( PRL ) secretion in male rats . To this end , we tested the effects of both unselective CCK agonists CCK - 8 and caerulein , and CCK-B selective agonists Q13308 and pentagastrin as well as the selective CCK antagonists ( devazepide and L -365,260 ) at wide dose-ranges on the cold-stimulated and TRH-induced DB00024 and PRL secretion . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , given s . c . 15 min before sacrifice , decreased DB00024 levels at 5 micrograms / kg . In time course-studies , the maximum inhibition was seen at 15 min but the effect lasted at least 30 , but less than 60 min . Also CCK - 8 decreased DB00024 levels at the doses of 20 and 50 micrograms / kg at 15 min . Devazepide and L -365,260 did not affect DB00024 or PRL levels at any dose . The effect of caerulein ( 5 micrograms / kg ) was antagonized by devazepide , a CCK-A antagonist , at 100 micrograms / kg , but not by a CCK-B antagonist L -365,260 tested at a wide dose range . PRL levels were not affected by any treatment . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ( 5 micrograms / kg ) , given at the same time as TRH ( 500 ng / kg ) , inhibited the TRH-induced DB00024 levels at 15 min , but not at 30 or 60 min . CCK - 8 ( 50 micrograms / kg ) , Q13308 ( 100 micrograms / kg ) and pentagastrin ( 500 micrograms / kg ) did not affect the TRH-induced DB00024 secretion . The results probably indicate that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 stimulation inhibits DB00024 secretion at the level of the anterior pituitary gland . PRL levels in male rats are not affected by CCK system .</div>

 10 mg impaired tracking performance and both doses impaired memory scanning speed . None of the other measures indicated impaired performance . CONCLUSION AND IMPLICATIONS :

 affects information processing speed , but these effects were not sufficient to serve as a model for cognitive deficits in clinical disorders .</div>

 gamma agonist-induced hepatotoxicity remains unknown . In this study , we examined the hepatotoxic effects of five

 gamma agonists by using the Rat Genome Survey Microarray system from Applied Biosystems in order to understand the mechanisms of hepatotoxicities induced by PPARgamma agonists . Consistent with the hepatotoxicity data , our results demonstrate that the gene expression profiles affected by troglitazone and ciglitazone can be clearly distinguished from those by pioglitazone and rosiglitazone . Genes that are differentially expressed between the more toxic troglitazone / ciglitazone group and the less toxic rosiglitazone / pioglitazone group are involved in necrotic , apoptotic , and cell proliferative pathways . The five compounds were also clustered based on a set of molecular descriptors . The clustering based on chemical structural information is in good agreement with the clustering of compounds based on cytotoxicity or gene expression data , indicating a strong relationship between chemical structure and biological endpoints . Our work suggests that microarray analysis together with toxicological observations can be used to rank drugs for hepatotoxicity and to evaluate the safety of new compounds .</div>

<h2 style="margin: 0">15</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Rindopepimut , a 14 - mer injectable peptide vaccine against EGFRvIII for the potential treatment of glioblastoma multiforme . Celldex Therapeutics is developing rindopepimut ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) , a 14 - mer injectable peptide vaccine for the potential treatment of glioblastoma multiforme ( GBM ) . Rindopepimut specifically targets a novel junctional epitope of the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 deletion mutant EGFRvIII , which is a constitutively active receptor that is expressed in approximately 60 to 70 % of patients with GBM . EGFRvIII expression is correlated with worse prognosis and reduced overall survival . Importantly , EGFRvIII is not expressed in normal brain tissue , making it an excellent therapeutic target . Preclinical studies demonstrated lasting tumor regression and increased survival times , as well as efficient generation of EGFRvIII-specific humoral and cellular immune responses , in animals expressing EGFRvIII and vaccinated with rindopepimut . Phase I and II clinical trials in patients with GBM demonstrated significantly increased median time to progression and overall survival time in those vaccinated with rindopepimut compared with matched historical controls . Only limited side effects have been observed in patients . Given these results , rindopepimut is an extremely promising therapy for patients with GBM . Phase I and II clinical trials in patients with GBM were ongoing at the time of publication . In the future , it may be beneficial to combine rindopepimut with other treatment modalities to further prolong survival .</div>

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 antagonism by cetirizine in isolated guinea pig tissues : influence of receptor reserve and dissociation kinetics . We characterised histamine H ( 1 ) receptor antagonism by cetirizine and its enantiomers on isolated guinea pig ileum and trachea . Competitive or mixed ( competitive and apparent noncompetitive ) antagonism profiles were observed . The order of potency was : chlorpheniramine &gt; or = mepyramine &gt; levocetirizine &gt; cetirizine &gt; or = terfenadine &gt; loratadine &gt; dextrocetirizine . The inhibitory effects of cetirizine , levocetirizine , terfenadine and loratadine were slowly reversible compared to those of dextrocetirizine or mepyramine . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00341
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 and its enantiomers were inactive on L-type Ca ( 2 + ) channels . Reduction of the histamine H ( 1 ) receptor reserve by dibenamine in the ileum ( 100 - fold higher than in the trachea ) showed a gradual change from the competitive profile of dextrocetirizine and mepyramine to a mixed profile . The present results show that cetirizine and levocetirizine are selective competitive but slowly reversible histamine H ( 1 ) receptor antagonists . Their mixed antagonism profile observed in the trachea can be explained by the small receptor reserve present in this tissue compared to the ileum and their very slow dissociation rate from the histamine H ( 1 ) receptor .</div>
